        onTagChange: '\n            var(m,0)\n            set(m,\'this.mode\')\n            var(tag,0)\n            getTag(tag)\n            var(tTag,0)\n            if(tag==0){\n                print(tag,\'tag is 0\')\n            }else{\n                set(tTag,tag)\n                var(len,0)\n                set(len,\'this.otherAttrs.0\')\n                minus(len,1)\n                var(flag1,0)\n                set(flag1,10)\n                var(flag2,0)\n                set(flag2,10)\n                if(m==0){\n                    set(flag1,2)\n                    set(flag2,5)\n                }else{\n                    if(m==1){\n                        set(flag1,2)\n                    }else{\n                        if(m==2){\n                            set(flag1,4)\n                            set(flag2,7)\n                        }else{\n                            if(m==3){\n                                set(flag1,4)\n                                set(flag2,7)\n                            }else{\n                                print(m,\'mode is unknown\')\n                            }\n                        }\n                    }\n                }\n                while(len>=0){\n                    if(len==flag1){\n                        minus(len,1)\n                    }else{\n                        if(len==flag2){\n                            minus(len,1)\n                        }else{\n                            mod(tTag,16)\n                            add(tTag,48)\n                            set(\'this.layers.len.subLayers.font.text\',tTag)\n                            divide(tag,16)\n                            set(tTag,tag)\n                            minus(len,1)\n                        }\n                    }\n                }\n            }\n        ',
